import React from 'react';
import "../css/Main.css";
import Bar from './Bar';

function Main() {
  return (
    <div className="mainbox">
      <div className="al mainleft">
        <div className="al tourindex">

        </div>
        <div className="al smallmenu">

          <div className="al visitcost">
            <div className="al visitormenu"></div>
            <div className="al costmenu"></div>
          </div>
          <div className="al tourkey">
            <div className="al toursearch"></div>
            <div className="al keywordsearch"></div>
          </div>
        </div>

      </div>
      <div className="al mainright">
        <div className="al tourindexmap">

        </div>
      </div>
    </div>
  );
}

export default Main;
